        КОМУ: Регистратуре

        Пожалуйста, направляйте всех пациентов с жалобами на чувство тревоги или проблемами с психикой в другие госпитали станции. У нас закончились свободные места и практически исчерпан запас препаратов эмоциональной коррекции.

